import Header from "./Header/Header";
import Profile from "./Profile/Profile";
import "./Structure.css";

const Structure = (props) => {
  return (
    <section className="struct">
      <div>
        <Profile></Profile>
      </div>

      <div>
        <Header></Header>
      </div>
      <div className="row">
       <h3>salam</h3>
       <h3>am</h3>sak
      </div>
      <h3>s</h3>
      <h3>s</h3>
    </section>
  );
};

export default Structure;
